DROP PROCEDURE IF EXISTS addCity;
DELIMITER //

CREATE PROCEDURE addCity(city_id INT, city_code VARCHAR(25), eiken_city_code VARCHAR(25), city_name VARCHAR(255))

BEGIN
    -- UPDATE/INSERT
    IF (EXISTS (SELECT `id` FROM `City` WHERE `id`=city_id)) THEN
        UPDATE `City` SET `CityName`=city_name, `CityCode`=city_code, `EikenCityCode`=eiken_city_code, `Status`='Enable' WHERE `id`=city_id;
    ELSE
    END IF;
    -- UPDATE relation table
    SET @oldCityId=(SELECT `id` FROM `City` WHERE `CityCode`= city_code COLLATE utf8_general_ci AND `id`!=city_id);
    IF (@oldCityId > 0) THEN
            -- InvitationLetter
            UPDATE InvitationLetter SET CityId = city_id WHERE CityId = @oldCityId;
            -- MainHallAddress
            UPDATE MainHallAddress SET CityId = city_id WHERE CityId = @oldCityId;
            -- Organization
            UPDATE Organization SET CityId = city_id WHERE CityId = @oldCityId;
            -- GoalPass
            UPDATE GoalPass SET CityId = city_id WHERE CityId = @oldCityId;     
            -- ApplyEikenLevel
            UPDATE ApplyEikenLevel SET CityId1=city_id WHERE CityId1=@oldCityId;
            UPDATE ApplyEikenLevel SET CityId2=city_id WHERE CityId2=@oldCityId;
            -- GoalPass
            UPDATE District SET CityId = city_id WHERE CityId = @oldCityId; 
            -- ApplyEikenOrg
            UPDATE ApplyEikenOrg SET CityId = city_id WHERE CityId = @oldCityId;    
    END IF;
END; //
