CREATE PROCEDURE updateDistrict(city_code INT, dis_id INT ,dis_code VARCHAR(25), dis_name VARCHAR (255), 
                        KyuOneFirstTime INT, KyuOneSecondTime INT, KyuPreOneFirstTime INT, KyuPreOneSecondTime INT, 
            KyuTwoFirstTime INT, KyuTwoSecondTime INT, KyuPreTwoFirstTime INT, KyuPreTwoSecondTime INT, KyuThreeFirstTime INT, 
            KyuThreeSecondTime INT, KyuFourFirstTime INT, KyuFiveFirstTime INT, ForHallType INT)
BEGIN
        SET @city_id = (SELECT id FROM City WHERE EikenCityCode=city_code LIMIT 1);
        -- UPDATE/INSERT
    IF (EXISTS (SELECT `id` FROM `District` WHERE `id`=dis_id)) THEN
        UPDATE `District` SET `CityId`=@city_id, `Code`= dis_code, `Name`= dis_name, `KyuOneFirstTime`= KyuOneFirstTime, `KyuOneSecondTime`= KyuOneSecondTime, 
                        `KyuPreOneFirstTime`= KyuPreOneFirstTime, `KyuPreOneSecondTime`= KyuPreOneSecondTime, 
            `KyuTwoFirstTime`= KyuTwoFirstTime, `KyuTwoSecondTime`= KyuTwoSecondTime, `KyuPreTwoFirstTime`= KyuPreTwoFirstTime, 
                        `KyuPreTwoSecondTime`= KyuPreTwoSecondTime, `KyuThreeFirstTime`= KyuThreeFirstTime, `KyuThreeSecondTime`= KyuThreeSecondTime,
            `KyuFourFirstTime`= KyuFourFirstTime, `KyuFiveFirstTime`= KyuFiveFirstTime, `ForHallType`= ForHallType WHERE `id`=dis_id;
    ELSE
                                `KyuTwoFirstTime`, `KyuTwoSecondTime`, `KyuPreTwoFirstTime`, `KyuPreTwoSecondTime`, `KyuThreeFirstTime`, 
                                `KyuThreeSecondTime`, `KyuFourFirstTime`, `KyuFiveFirstTime`, `ForHallType`) 
                VALUES (dis_id, @city_id, dis_code, dis_name, KyuOneFirstTime, KyuOneSecondTime, KyuPreOneFirstTime, KyuPreOneSecondTime, 
                    KyuTwoFirstTime, KyuTwoSecondTime, KyuPreTwoFirstTime, KyuPreTwoSecondTime, KyuThreeFirstTime, 
                    KyuThreeSecondTime, KyuFourFirstTime, KyuFiveFirstTime, ForHallType);
    END IF;
    -- UPDATE relation table
    SET @oldDistrictId=(SELECT `id` FROM `District` 
                                            WHERE `Code`= dis_code COLLATE utf8_general_ci 
                                                        AND `Name` = dis_name COLLATE utf8_general_ci 
                                                        AND `id`!=dis_id ORDER BY `id` ASC LIMIT 1);
    IF (@oldDistrictId > 0) THEN     
            -- ApplyEikenLevel
            UPDATE ApplyEikenLevel SET DistrictId1=dis_id WHERE DistrictId1=@oldDistrictId;
            UPDATE ApplyEikenLevel SET DistrictId2=dis_id WHERE DistrictId2=@oldDistrictId; 
            -- ApplyEikenOrg
            UPDATE ApplyEikenOrg SET DistrictId = dis_id WHERE DistrictId = @oldDistrictId;    
    END IF;
        -- UPDATE relation table
    SET @oldDistrictId=(SELECT `id` FROM `District` 
                                            WHERE `Code`= dis_code COLLATE utf8_general_ci 
                                                        AND `Name` = dis_name COLLATE utf8_general_ci 
                                                        AND `id`!=dis_id ORDER BY `id` DESC LIMIT 1);
    IF (@oldDistrictId > 0) THEN     
            -- ApplyEikenLevel
            UPDATE ApplyEikenLevel SET DistrictId1=dis_id WHERE DistrictId1=@oldDistrictId;
            UPDATE ApplyEikenLevel SET DistrictId2=dis_id WHERE DistrictId2=@oldDistrictId; 
            -- ApplyEikenOrg
            UPDATE ApplyEikenOrg SET DistrictId = dis_id WHERE DistrictId = @oldDistrictId;    
    END IF;

END //
