    -- Insert Action record
    IF (EXISTS (SELECT id FROM `Action` WHERE `Title` = @titleAction COLLATE utf8_unicode_ci LIMIT 1) ) THEN
        SET @lastInsertActionID = (SELECT id FROM `Action` WHERE `Title` = @titleAction COLLATE utf8_unicode_ci LIMIT 1); 
    ELSE
