INSERT IGNORE INTO `DoubleEikenMessages` (`id`, `Title`, `Message`, `UpdateAt`, `UpdateBy`, `InsertAt`, `InsertBy`, `Status`, `IsDelete`) VALUES
(1, '対応可能', 'ダブル受験とは、連続した2つの級（例：4級と3級）を一緒に受験することが出来る制度です。ダブル受験を希望する場合は登録、もしくは支払の際に希望する受験級を2つ選択して手続きを行なってください。', '2015-07-16 12:40:33', '', '2015-07-16 12:40:33', 'ManhNH5', NULL, 0),
(2, '要相談', 'ダブル受験とは、連続した2つの級（例：4級と3級）を一緒に受験することが出来る制度です。ダブル受験を希望する場合は事前に先生に相談の上、手続きの方法について確認をしてください。', '2015-07-16 12:40:33', '', '2015-07-16 12:40:33', 'ManhNH5', NULL, 0),
(3, '対応不可', 'ダブル受験とは、連続した2つの級（例：4級と3級）を一緒に受験することが出来る制度です。今回の団体受験ではダブル受験の受付を行なっていません。希望する場合は個人で申込をする必要があります。', '2015-07-16 12:40:33', '', '2015-07-16 12:40:33', 'ManhNH5', NULL, 0);
