INSERT IGNORE INTO `ConditionMessages` (`id`, `EikenLevelId`, `Condition`, `Messages`, `Type`, `UpdateAt`, `UpdateBy`, `InsertAt`, `InsertBy`, `Status`, `IsDelete`) VALUES
(2, 1, NULL, '大学上級程度の問題が出題されます。二次試験では2分間のスピーチと、その内容への質問がなされます。カギは英語の知識のみでなく、相手に伝える発信力と対応力。世界で活躍できる人材の英語力を証明します。', 2, '2015-07-21 09:01:59', 'SystemAdmin', '2015-07-21 09:01:59', 'SystemAdmin', 'Active', 0),
(3, 2, NULL, '大学中級程度の問題が出題されます。Eメールへの返信など実践的な英作文の問題が加わります。「実際に使える英語力」の証明として高く評価されています。', 2, '2015-07-21 09:02:23', 'SystemAdmin', '2015-07-21 09:02:23', 'SystemAdmin', 'Active', 0),
(4, 3, NULL, '高校卒業程度の英語力が問われます。 医療やテクノロジーなど社会性のある英文読解も出題されます。海外留学、国内での入試優遇・単位認定など、コミュニケーション力が高く評価されます。', 2, '2015-07-21 09:02:55', 'SystemAdmin', '2015-07-21 09:02:55', 'SystemAdmin', 'Active', 0),
(5, 4, NULL, '高校中級程度の英語力が問われます。教育や科学などを題材とした、長文の穴埋め問題が加わります。センター試験の問題形式と共通点が多く、入試対策にも最適です。', 2, '2015-07-21 09:03:06', 'SystemAdmin', '2015-07-21 09:03:06', 'SystemAdmin', 'Active', 0),
(6, 5, NULL, '中学卒業程度の英語力が問われます。二次試験でスピーキングテスト。英語で考えを伝えましょう。筆記試験の題材は、海外の文化など少し視野が広がります。', 2, '2015-07-21 09:03:18', 'SystemAdmin', '2015-07-21 09:03:18', 'SystemAdmin', 'Active', 0),
(7, 6, NULL, '中学中級程度の問題が出題されます。出題形式や内容が、より実用的に。身近なトピックを題材とした読解問題が加わります。基礎力をぐんぐん伸ばしていきましょう。', 2, '2015-07-21 09:03:28', 'SystemAdmin', '2015-07-21 09:03:28', 'SystemAdmin', 'Active', 0),
(8, 7, NULL, '中学初級程度の問題が出題されます。英語を習い始めた方の最初の目標。家族のこと、趣味やスポーツなど身近な話題が出題されます。英語の基礎固めに最適です。', 2, '2015-07-21 09:03:39', 'SystemAdmin', '2015-07-21 09:03:39', 'SystemAdmin', 'Active', 0),
(9, 1, NULL, '一次試験：筆記（100分）、リスニング（約30分） / 二次試験：面接（約10分）', 3, '2015-07-21 10:44:18', 'SystemAdmin', '2015-07-21 10:44:18', 'SystemAdmin', 'Active', 0),
(10, 2, NULL, '一次試験：筆記（90分）、リスニング（約25分） / 二次試験：面接（約8分）', 3, '2015-07-21 10:44:33', 'SystemAdmin', '2015-07-21 10:44:33', 'SystemAdmin', 'Active', 0),
(11, 3, NULL, '一次試験：筆記（75分）、リスニング（約25分） / 二次試験：面接（約7分）', 3, '2015-07-21 10:44:54', 'SystemAdmin', '2015-07-21 10:44:54', 'SystemAdmin', 'Active', 0),
(12, 4, NULL, '一次試験：筆記（65分）、リスニング（約25分） / 二次試験：面接（約6分）', 3, '2015-07-21 10:45:12', 'SystemAdmin', '2015-07-21 10:45:12', 'SystemAdmin', 'Active', 0),
(13, 5, NULL, '一次試験：筆記（40分）、リスニング（約25分） / 二次試験：面接（約5分）', 3, '2015-07-21 10:45:27', 'SystemAdmin', '2015-07-21 10:45:27', 'SystemAdmin', 'Active', 0),
(14, 6, NULL, '筆記（35分）、リスニング（約30分）', 3, '2015-07-21 10:45:47', 'SystemAdmin', '2015-07-21 10:45:47', 'SystemAdmin', 'Active', 0),
(15, 7, NULL, '筆記（25分）、リスニング（約20分）', 3, '2015-07-21 10:46:01', 'SystemAdmin', '2015-07-21 10:46:01', 'SystemAdmin', 'Active', 0),
(16, 1, NULL, '●通訳案内士試験（通訳ガイド試験）において、外国語（英語）の筆記試験が免除されます。\r\n●全国の高校・高専や短大・大学約1930校で、入試時の優遇措置や単位認定、社会人入試時の優遇措置などが受けられます。\r\n●アメリカやオーストラリアなどへ留学する際の英語力の証明資格として認定されています。\r\n●教員採用試験で特別措置をする自治体があります。\r\n●高卒認定試験（旧大検）で英語科目の受験が免除されます。', 4, '2015-07-21 10:46:32', 'SystemAdmin', '2015-07-21 10:46:32', 'SystemAdmin', 'Active', 0),
(17, 2, NULL, '●全国の高校・高専約560校で入試時の優遇措置及び約640校で単位認定が受けられます。\r\n●全国の短大・大学約380校で入試時の優遇措置及び約290校で単位認定が受けられます。\r\n●アメリカやオーストラリアなどへ留学する際の英語力の証明資格として認定されています。\r\n●高卒認定試験（旧大検）で英語科目の受験が免除されます。\r\n●教員採用試験で特別措置をする自治体があります。', 4, '2015-07-21 10:46:47', 'SystemAdmin', '2015-07-21 10:46:47', 'SystemAdmin', 'Active', 0),
(18, 3, NULL, '●全国の高校・高専約550校で入試時の優遇措置及び約640校で単位認定が受けられます。\r\n●全国の短大・大学約360校で入試時の優遇措置及び約180校で単位認定が受けられます。\r\n●アメリカやオーストラリアなどへ留学する際の英語力の証明資格として認定されています。\r\n●高卒認定試験（旧大検）で英語科目の受験が免除されます。', 4, '2015-07-21 10:47:09', 'SystemAdmin', '2015-07-21 10:47:09', 'SystemAdmin', 'Active', 0),
(19, 4, NULL, '●全国の高校・高専約540校で入試時の優遇措置及び約370校で単位認定が受けられます。\r\n●全国の短大・大学約260校で入試時の優遇措置及び約30校で単位認定が受けられます。\r\n●高卒認定試験（旧大検）で英語科目の受験が免除されます。', 4, '2015-07-21 10:47:27', 'SystemAdmin', '2015-07-21 10:47:27', 'SystemAdmin', 'Active', 0),
(20, 5, NULL, '●全国の高校・高専約420校で入試時の優遇措置及び約120校で単位認定が受けられます。\r\n●全国の短大・大学約70校で入試時の優遇措置が受けられます。\r\n一つ上の準２級に合格すると上記に加えて\r\n◆全国の高校・高専や短大・大学で入試時の優遇措置や単位認定を行う学校がさらに増えます。\r\n◆高卒認定試験（旧大検）で英語科目の受験が免除されます。', 4, '2015-07-21 10:48:02', 'SystemAdmin', '2015-07-21 10:48:02', 'SystemAdmin', 'Active', 0),
(21, 6, NULL, '英検を合格することにより得られるメリットは、級が上がるにつれて幅が広がっていきます。\r\n例えば、3級に合格すると\r\n●全国の高校・高専約420校で入試時の優遇措置及び約120校で単位認定が受けられるほか、短大・大学約70校で入試時の優遇措置が受けられます。', 4, '2015-07-21 10:48:17', 'SystemAdmin', '2015-07-21 10:48:17', 'SystemAdmin', 'Active', 0),
(22, 7, NULL, '英検を合格することにより得られるメリットは、級が上がるにつれて幅が広がっていきます。\r\n例えば、3級に合格すると\r\n●全国の高校・高専約420校で入試時の優遇措置及び約120校で単位認定が受けられるほか、短大・大学約70校で入試時の優遇措置が受けられます。', 4, '2015-07-21 10:48:37', 'SystemAdmin', '2015-07-21 10:48:37', 'SystemAdmin', 'Active', 0),
(23, 1, NULL, 'TIMEやNewsWeekなど雑誌の社会的、経済的、文化的な記事を理解することができる', 6, '2015-07-21 10:50:03', 'SystemAdmin', '2015-07-21 10:50:03', 'SystemAdmin', 'Active', 0),
(24, 2, NULL, '英字新聞で社会的な出来事に関する記事を読むことができる', 6, '2015-07-21 10:50:14', 'SystemAdmin', '2015-07-21 10:50:14', 'SystemAdmin', 'Active', 0),
