INSERT IGNORE INTO `TemplateInvitationMsg` (`id`, `Name`, `Messages`, `Type`, `UpdateAt`, `UpdateBy`, `InsertAt`, `InsertBy`, `Status`, `IsDelete`) VALUES
(1, '生徒向けテンプレート（第1回用）', '今回の試験は、一次試験を6月●●日（●）に本校で行うことを予定しています。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めています。\n6月、10月、1月の年に3回、英検を行う予定ですが、まずは今の実力を測るためにもこれまでに学習した内容をしっかりと復習し挑戦してみましょう。今の時期に目標をクリアできれば、かなりの英語力を身に付けた証明となります。\nすでに合格している生徒の皆さんはさらに上の級の合格を目指しましょう。まずは1次合格が目標ですが、3級以上を受験する皆さんは2次合格も目指して取り組んでください。\n', 0, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0),
(2, '生徒向けテンプレート（第2回用）', '今回の試験は、一次試験を10月●●日（●）に本校で行うことを予定しています。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めています。\n10月の後は来年1月に英検を行う予定ですが、ここまで学習した成果を客観的に評価し、これからの英語学習に活かす非常によい機会です。これまでに学習した内容をしっかりと復習し挑戦しましょう。\nすでに合格している生徒の皆さんはさらに上の級の合格を目指しましょう。まずは1次合格が目標ですが、3級以上を受験する皆さんは2次合格も目指して取り組んでください。\n', 0, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0),
(3, '生徒向けテンプレート（第3回用）', '今回の試験は、一次試験を1月●●日（●）に本校で行うことを予定しています。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めています。\n今年度最後の英検となります。今後は学年があがるにつれてより高度な内容となってきますので、この1年間の集大成としてしっかりと復習し挑戦しましょう。\nすでに級を持っている生徒の皆さんはさらに上の級の合格を目指しましょう。まずは1次合格が目標ですが、3級以上を受験する皆さんは2次合格も目指して取り組んでください。', 0, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0),
(4, '保護者向けテンプレート（第1回/4月用）', '陽春の候、保護者各位に於かれましては益々御清祥のこととお慶び申し上げます。平素は本校の教育活動に格別のご理解を賜りありがとうございます。\nさて、このたび本校では来る6月●●日（●）に20●●年度第1回の実用英語技能検定（以下、英検）を実施致します。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めており、6月、10月、1月の年に3回、英検を行う予定です。英検は個人の英語力に応じた級を受けられるという特徴があります。「読む」、「聞く」、「話す」、「書く」の4技能が対象となるため、英語力をバランス良く評価することが可能となっています。また英検に合格することで自身の英語学習の励みになるだけでなく、英検取得者は入学試験等での優遇制度もあります。今の実力を測るためにもぜひ奮って受験するよう、ご子息・ご息女にお勧めください。\nなおご質問・不明な点がありましたら、お気軽にお問い合わせ下さい。', 1, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0),
(5, '保護者向けテンプレート（第1回/5月用）', '新緑の候、保護者各位に於かれましては益々御清祥のこととお慶び申し上げます。平素は本校の教育活動に格別のご理解を賜りありがとうございます。\nさて、このたび本校では来る6月●●日（●）に20●●年度第1回の実用英語技能検定（以下、英検）を実施致します。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めており、6月、10月、1月の年に3回、英検を行う予定です。英検は個人の英語力に応じた級を受けられるという特徴があります。「読む」、「聞く」、「話す」、「書く」の4技能が対象となるため、英語力をバランス良く評価することが可能となっています。また英検に合格することでご子息・ご息女自身の英語学習の励みにもなりますし、英検取得者は入学試験等での優遇制度もあります。今の実力を測るためにもぜひ奮って受験するよう、ご子息・ご息女にお勧めください。\nなおご質問・不明な点がありましたら、お気軽にお問い合わせ下さい。', 1, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0),
(6, '保護者向けテンプレート（第2回/8月上旬用）', '盛夏の候、保護者各位に於かれましては益々御清祥のこととお慶び申し上げます。平素は本校の教育活動に格別のご理解を賜りありがとうございます。\nさて、このたび本校では来る10月●●日（●）に20●●年度第2回の実用英語技能検定（以下、英検）を実施致します。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めており、今年度はこの後1月にも英検を行う予定です。英検は個人の英語力に応じた級を受けられるという特徴があります。「読む」、「聞く」、「話す」、「書く」の4技能が対象となるため、英語力をバランス良く評価することが可能となっています。また英検に合格することでご子息・ご息女自身の英語学習の励みにもなりますし、英検取得者は入学試験等での優遇制度もあります。今の自分の実力を客観的に評価するために非常によい機会ですので、ぜひ奮って受験するよう、ご子息・ご息女にお勧めください。\nなおご質問・不明な点がありましたら、お気軽にお問い合わせ下さい。', 1, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0),
