(8, '保護者向けテンプレート（第3回/12月用）', '師走の候、保護者各位に於かれましては益々御清祥のこととお慶び申し上げます。平素は本校の教育活動に格別のご理解を賜りありがとうございます。\nさて、このたび本校では来る1月●●日（●）に20●●年度第3回の実用英語技能検定（以下、英検）を実施致します。\n本校では、1年生●級、2年生●級、3年生●級を取得することを勧めており、今年度の最後の英検となります。英検は個人の英語力に応じた級を受けられるという特徴があります。「読む」、「聞く」、「話す」、「書く」の4技能が対象となるため、英語力をバランス良く評価することが可能となっています。また英検に合格することでご子息・ご息女自身の英語学習の励みにもなりますし、英検取得者は入学試験等での優遇制度もあります。この1年間の集大成として非常によい機会ですので、ぜひ奮って受験するよう、ご子息・ご息女にお勧めください。\nなおご質問・不明な点がありましたら、お気軽にお問い合わせ下さい。', 1, '2015-07-30 12:42:16', 'SystemAdmin', '2015-07-30 12:42:16', 'SystemAdmin', 'Enable', 0);
